import '../../assets/styles/header.css'
import Particles from "react-tsparticles";

function Header() {
    return (
        <div>
            <Particles
                params={{
                    "particles": {
                        "number": {
                            "value": 50
                        },
                        "size": {
                            "value": 3
                        }
                    },
                    "interactivity": {
                        "events": {
                            "onhover": {
                                "enable": false,
                                "mode": "repulse"
                            }
                        }
                    }
                }}
            />
            <header>
                Publish your ideas
            </header>
        </div>

    );
}

export default Header;
